import React from "react";
import logo from "./assets/images/logo.png";
function App() {
  return (
    <section>
      {/* <button>Log in</button> */}
      <div className="content">
        <img src={logo} alt="logo" />
        <h1>Enjoy Thoughtful Entertainment</h1>
        <p>
          Stream thousands of films for free, thanks to the generous support of
          your public library or university
        </p>
        <button>Get Started</button>
        <p>
          Available in participating public libraries, colleges and
          universities.
        </p>
      </div>
    </section>
  );
}

export default App;
